import React from 'react'
import Togglable from './Togglable'

const Blog = ({ blog, showDetails }) => {
  if(!showDetails){
    return (
      <div>
        {blog.title} {blog.author}
      </div>
    )
  }else{
    return (
      <div>
          <p>{blog.title}</p>
          <p>{blog.author}</p>
          <p>{blog.url}</p>
          <p>{blog.likes}</p>
          <p>{blog.user}</p>
      </div>
  )
  }
}

export default Blog
